import React from "react";
import { ModalContent } from './ModalStyles';

const ModalProductos = ({ isModalOpen, toggleModal, openConfirmationModal }) => {
    return (
        <Modal isOpen={isModalOpen} onRequestClose={toggleModal} contentLabel="Formulario de Nueva Orden" style={{
            overlay: {
                background: "linear-gradient(135deg, #0a192f, #1f4068)", // ðŸ”¹ Azul oscuro con degradado
            },
            content: {
                width: "50%",
                margin: "auto",
                padding: "20px",
                borderRadius: "8px",
                background: "black",
                border: "none"
            },
        }}>
            <ModalContent>
                <h1>Modal</h1>
            </ModalContent>
        </Modal>
    )
}

export default ModalProductos
